import {
  Modal,
  ModalOverlay,
  ModalContent,
  ModalHeader,
  ModalFooter,
  ModalBody,
  ModalCloseButton,
  useDisclosure,
  Button,
  FormControl,
  FormLabel,
  Input,
} from '@chakra-ui/react'
import React, { useState } from 'react'
import {useDrivePicker ,GooglePicker} from "react-google-drive-picker";


const CreateModel = ({children}) => {
  const { isOpen, onOpen, onClose } = useDisclosure()
  const [name,setname] = useState()
  const [age,setage] = useState()
  const [gender,setgender] = useState()
  const [pid,setpid] = useState()
  const [file1,setfile1] = useState()
  const [file2,setfile2] = useState()
  const [status,setstatus] = useState()


  const [openPicker, data, authResponse] = useDrivePicker();

  const handleOpenPicker = ()=>{
    openPicker({
      clientId:"296260046482-dbobpi9s5afda74q2o5ih9iocl1ti2la.apps.googleusercontent.com",
      developerKey:"AIzaSyBqwEko3rn5n7oDkE266va5SlTNP9X9fpQ",
      viewId:"DOCS",
     
      //token:"##youraccesstoken##", // pass oauth token in case you already have one
      
      showUploadFolders: true,
      supportDrives: true,
      multiselect: true,
      
      // customViews: customViewsArray, // custom view
    });
return(    <GooglePicker clientId={'your-client-id'}
              developerKey={'your-developer-key'}
              scope={['https://www.googleapis.com/auth/drive.readonly']}
              onChange={data => console.log('on change:', data)}
              onAuthFailed={data => console.log('on auth failed:', data)}
              multiselect={true}
              navHidden={true}
              authImmediate={false}
              mimeTypes={['image/png', 'image/jpeg', 'image/jpg']}
              query={'a query string like .txt or fileName'}
              viewId={'DOCS'}>
   <MyCustomButton />
</GooglePicker>)






  }


  return (
    <>
     <span  onClick={onOpen}>{children}</span>

    <Modal isOpen={isOpen} onClose={onClose}>
      <ModalOverlay />
      <ModalContent>
        <ModalHeader>New Application</ModalHeader>
        <ModalCloseButton />
        <ModalBody>
        <FormControl>
              <FormLabel>Name</FormLabel>
              <Input  placeholder='name' />
            </FormControl>

            <FormControl mt={4}>
              <FormLabel>age</FormLabel>
              <Input placeholder='age' />
            </FormControl>
            <FormControl mt={4}>
              <FormLabel>gender</FormLabel>
              <Input placeholder='gender' />
            </FormControl>

            <FormControl mt={4}>
              <FormLabel>file</FormLabel>
              <Input placeholder='age' />
            </FormControl>
            <FormControl id="pic">
      <FormLabel>Upload your 1st File</FormLabel>
          <Button onClick={() => handleOpenPicker()}></Button>
    </FormControl>
    <FormControl id="pic">
      <FormLabel>Upload your 2nd File</FormLabel>
      <Button onClick={() => handleOpenPicker()}></Button>
    </FormControl>
        </ModalBody>

        <ModalFooter>
          <Button colorScheme='blue' mr={3} onClick={onClose}>
            Close
          </Button>
          <Button variant='ghost'>Submit</Button>
        </ModalFooter>
      </ModalContent>
    </Modal></>
   
  )
}

export default CreateModel
